window.bookSummaryJSON = "<p><b>The final battle for the fate of two realms begins.</b></p> <p>Reopening the veil between Tirnanog and Castella once seemed like a solution, but now Valeria and Korben find themselves in a race against time to save those they love.</p> <p>Korben returns to a kingdom in ruin, ruled by a tyrant he thought long dead. His people live in fear, and the magic that once flowed freely through the realm has disappeared.</p> <p>To have a fighting chance, Valeria and Korben must restore magic. To do that, they must find the creator of The Eldrystone, an elusive goddess who seems little more than a forgotten fairytale. Their search will lead them to a land of peril where they might lose more than they bargained for.</p> <p>Flight of the Raven<i> is fantasy romance featuring a damaged villain and the fierce princess who will shred his heart to pieces if he isn't careful. For mature listeners.</i></p>"; 
